(2, 69, 'Roy Stone', 'roy@gmail.com', '', '119.156.122.167', '2017-11-08 17:01:09', '2017-11-08 17:01:09', 'It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using', 0, '1', '', '', 0, 0),
(3, 69, 'James Adam', 'james@gmail.com', '', '182.176.183.187', '2018-01-01 17:28:46', '2018-01-01 17:28:46', 'Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy.', 0, '1', '', '', 2, 0),
(4, 69, 'Jenifer Joy', 'jenifer@gmail.com', '', '182.176.183.187', '2018-01-01 17:31:18', '2018-01-01 17:31:18', 'All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this.  It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable.', 0, '1', '', '', 0, 0),
